# Osmotic potential
def osmo_comp(pi_ft:float, # Osmotic potential at full turgor (MPa)
              r_stemp:float # Unknown parameter
              ) -> float:

        "Compute osmotic potential"
        return pi_ft / (1 - r_stemp)
